1/ Section XISECTION XI
MATIERES TEXTILES ET OUVRAGES EN CES MATIERES
Notes.
1. - La présente Section ne comprend pas :
a) les poils et soies de brosserie (n° 05.02), les crins et déchets de crins (n° 05.11);
b) les cheveux et ouvrages en cheveux (n°s 05.01, 67.03 ou 67.04); toutefois, les toiles
filtrantes, les tissus épais et les étindrellesen cheveux des types communément utilisés
pour les presses d'huilerie ou pour des usages techniques analogues sont repris au n°
59.11;
c) les linters de coton et autres produits végétaux du Chapitre 14;
d) l'amiante (asbeste) du n° 25.24 et articles en amiante et autres produits des n°s 68.12 ou
68.13;
e) les articles des n°s 30.05 ou 30.06; les fils utilisés pour nettoyer les espaces interdentaires
(fils dentaires), en emballages individuels de détail, du n° 33.06 ;
f) les textiles sensibilisés des n°s 37.01 à 37.04;
g) les monofilaments dont la plus grande dimension de la coupe transversale excède 1 mm et
les lames et formes similaires (paille artificielle, par exemple) d'une largeur apparente
excédant 5mm, en matière plastique (Chapitre 39), ainsi que les tresses, tissus et autres
ouvrages de sparterie ou de vannerie en ces mêmes articles (Chapitre 46);
h) les tissus, étoffes de bonneterie, feutres et nontissés, imprégnés, enduits ou recouverts de
matière plastique ou stratifiés avec cette même matière, et les articles en ces produits,

et les articles en ces produits, du
Chapitre 39;
ij) les tissus, étoffes de bonneterie, feutres et nontissés, imprégnés, enduits ou recouverts de
caoutchouc ou stratifiés avec cette même matière, et les articles en ces produits, du
Chapitre 40;
k) les peaux non épilées (Chapitres 41 ou 43) et les articles en pelleteries naturelles ou
factices des n°s 43.03 ou 43.04;
l) les articles en matières textiles des n°s 42.01 ou 42.02; 
m) les produits et articles du Chapitre 48 (l'ouate de cellulose, par exemple);
n) les chaussures et parties de chaussures, guêtres, jambières et articles analogues du
Chapitre 64;
o) les résilles, filets à cheveux et autres coiffures et leurs parties, du Chapitre 65;
p) les produits du Chapitre 67;
q) les produits textiles revêtus d'abrasifs (n° 68.05), ainsi que les fibres de carbone et
ouvrages en ces fibres du n° 68.15;
r) les fibres de verre, les articles en fibres de verre et les broderies chimiques ou sans fond
visible dont le fil brodeur est en fibres de verre (Chapitre 70);
s)les articles du Chapitre 94 (meubles, articles de literie,luminaires et appareils d'éclairage,
par exemple);
t) les articles du Chapitre 95 (jouets, jeux, engins sportifs, filets pour activités sportives, par
exemple);
u) les articles du Chapitre 96 (brosses, assortiments de voyage pour la couture, fermetures à
glissière, rubans encreurs pour machines à écrire,serviettes et tampons hygiéniques,
couches, par exemple) ;
v) les articles du Chapitre 97.

2/ Section XIleur poids total comme constituant une matière textile distincte; les fils de métal sont
considérés comme une matière textile pour le classement des tissus dans lesquels ils
sont incorporés;
b) le choix de la position à retenir pour le classement s'opère en déterminant, en premier
lieu, le Chapitre, puis, au sein de ce Chapitre, la position applicable, abstraction faite de
toute matière textile n'appartenant pas à ce Chapitre;
c) lorsque les Chapitres 54 et 55 sont tous deux à prendre en considération avec un autre
Chapitre, ces deux Chapitres sont traités comme un seul et même Chapitre;
d) lorsqu'un Chapitre ou une position se rapportent à plusieurs matières textiles, celles-ci
sont traitées comme constituant une seule matière textile.
C) Les dispositions des paragraphes A) et B) s'appliquent aussi aux fils spécifiés aux Notes 3,
4, 5 ou 6 ci-après.
3.- A) Sous réserve des exceptions prévues au paragraphe B) ci-après, on entend dans la 
présente Section par ficelles, cordes et cordages les fils (simples, retors ou câblés) :
a) de soie ou de déchets de soie titrant plus de 20.000 décitex;
b) de fibres synthétiques ou artificielles (y compris ceux faits de deux ou plusieurs
monofilaments du Chapitre 54), titrant plus de 10.000 décitex;
c) de chanvre ou de lin :
1°) polis ou glacés, titrant 1.429 décitex ou plus;
2°) non polis ni glacés, titrant plus de 20.000 décitex;
d) de coco, comportant trois bouts ou plus ;
e) d'autres fibres végétales, titrant plus de 20.000 décitex;
f) armés de fils de métal.

B) Les dispositions ci-dessus ne s'appliquent pas :
a) aux fils de laine, de poils ou de crin, et aux fils de papier, non armés de fils de métal;
b) aux câbles de filaments synthétiques ou artificiels du Chapitre 55 et aux multifilaments
sans torsion ou avec une torsion inférieure à 5 tours par mètre du Chapitre 54;
c) au poil de Messine du n° 50.06, et aux monofilaments du Chapitre 54;
d) aux filés métalliques du n° 56.05; les fils textiles armés de fils de métal sont régis par le
paragraphe A) f) ci-dessus;
e) aux fils de chenille, aux fils guipés et aux fils dits "de chaînette" du n° 56.06.
